import 'dart:convert';import 'package:floor/floor.dart';@entityclass SubjectTestData {  @primaryKey  int? id;  String? nameUz;  String? nameRu;  String? shortName;  String? savedTest;  int? order;  // String? result;  SubjectTestData({this.id, this.nameUz, this.nameRu, this.shortName, this.savedTest, this.order,});  SubjectTestData.fromJson(Map<String, dynamic> json) {    id = json["id"];    nameUz = json["name_uz"];    nameRu = json["name_ru"];    shortName = json["short_name"];    savedTest = json["saved_test"]??"";    order = json["order"];    // result = jsonEncode(Result.fromJson(json["result"]??"").toJson());  }  Map<String, dynamic> toJson() =>      {        "id": id,        "name_uz": nameUz,        "name_ru": nameRu,        "short_name": shortName,        "saved_test": savedTest,        "order": order,        // "result": result,      };}class Result {  int? questionCount;  int? correctAnswersCount;  int? incorrectAnswersCount;  int? maxResultCorrects;  int? percent;  int? maxResultPercent;  Result({    this.questionCount,    this.correctAnswersCount,    this.incorrectAnswersCount,    this.maxResultCorrects,    this.percent,    this.maxResultPercent,  });  Result.fromJson(Map<String, dynamic> json) {    questionCount = json['question_count'];    correctAnswersCount = json["correct_answers_count"];    incorrectAnswersCount = json["incorrect_answers_count"];    maxResultCorrects = json["max_result_corrects"];    percent = json["percent"];    maxResultPercent = json["max_result_percent"];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data[ "question_count"] = questionCount;    data[ "correct_answers_count"] = correctAnswersCount;    data[ "incorrect_answers_count"] = incorrectAnswersCount;    data[ "max_result_corrects"] = maxResultCorrects;    data[ "percent"] = percent;    data[ "max_result_percent"] = maxResultPercent;    return data;  }}